var Hapi = require('hapi');
var Fs = require('fs');
var PDFDocument = require('pdfkit')
var _ = require("lodash")

var internals = {
  saveSign: function(image_base64) {
    image_base64 = image_base64.replace("data:image/png;base64,", "");
    filepath = './lib/web/public/assets/images/uploads/sign.png';
    Fs.writeFile(filepath, new Buffer(image_base64, 'base64'));
  },
  createPDF: function(callback) {
    doc = new PDFDocument

    doc.addPage()
       .fontSize(25)
       .text('Here is some vector graphics...', 100, 100)
     
    doc.save()
       .moveTo(100, 150)
       .lineTo(100, 250)
       .lineTo(200, 250)
       .fill("#FF3300")
     
    doc.output(callback);
  },
  validate: function(params, validate, callback) {
  },

  sendPDF: function(options) {
  }
};

exports.download = {
  auth: true,
  handler: function(request, reply) {
    internals.createPDF(function(buffer) {
      return reply(buffer);
    });
  }
}

exports.list = {
  auth: true,
  handler: function(request, reply) {
    user_id = request.auth.credentials._id;
    query = request.server.plugins['mongodb'].query
    query.findAll("note", {user_id: user_id}, function(objects) {
      return reply(objects)
    });
  }
}

exports.read = {
  auth: true,
  handler: function(request, reply) {
    user_id = request.auth.credentials._id;
    id = request.query.id
    query = request.server.plugins['mongodb'].query
    query.findOne("note", {id: id, user_id: user_id}, function(object) {
      return reply(object);
    });
  }
}
